blkName = gcb;

if strcmp(get_param(gcbh,'OutDataTypeStr'),'boolean')
	setValue = 'boolean';
else
	setValue = 'fixdt(0, 8)';
end

set_param([blkName,'/Compare'],'relop',relop, ...
	'OutDataTypeStr', setValue, 'ZeroCross', ZeroCross);

str = [relop,' C']; %default

const_str = get_param(blkName, 'const');
const_val = str2num(const_str);

if isempty(const_val) %#ok<ST2NM>
    %Expression/Variable
    str = [relop, ' ', strtrim(const_str)];
else
    if length(const_val) == 1 
        if Simulink.data.isSupportedEnumClass(class(const_val))
            % Special Handling for Enumerations
            if Simulink.data.getEnumTypeInfo(class(const_val), 'AddClassNameToEnumNames')
                str = [relop, ' ', strtrim(const_str)];
            else
                str = [relop, ' ', char(const_val)];
            end
        elseif(isfloat(const_val) || isinteger(const_val) || islogical(const_val)) 
                str = [relop, ' ', num2str(const_val)];
        end
    end
end

